import { Component, useState, Fragment } from "react";
import logo from "./logo.svg";
import "./App.css";
import Header from "./Components/Header";
import Body from "./Components/Body";

function App() {
  const [test, setTest] = useState({
    title: "title",
    content: "content",
    array: [
      <h1>h1tag</h1>,
      "just text",
      <input type="radio"></input>,
      <div>divtag</div>,
    ],
  });
  function settestfunc() {
    setTest({
      title: "update title",
      content: "update content",
      array: test.array,
    });
  }
  const [hanatest, sethana] = useState({
    number: "1",
  });
  function sethana1() {
    sethana({
      number: "2",
    });
  }
  const numbers = [1, 2, 3, 4, 5];
  const numPlus1 = numbers.map((number) => <li>{number}</li>);
  const [kyePrac, asdf] = useState([
    {
      id: 0,
      name: "hana",
      age: "10",
    },
    {
      id: 0,
      name: "hana2",
      age: "20",
    },
    {
      id: 0,
      name: "hana3",
      age: "30",
    },
  ]);

const name = 'react'

  return (
    // <div className="App">
    <>
      <Header></Header>
      <div> {name === 'react'? (<h1>If test - react</h1>):
      (<h1>Not react</h1>)}</div>
      <Body
        title={test.title}
        updateTitle={settestfunc}
        number={hanatest.number}
        updateNum={sethana1}
        array={test.array}
        numbers={numbers}
        numPlus1={numPlus1}
        kyePrac={kyePrac}
      ></Body>
      {/* </div> */}
    </>
  );
}

export default App;
